import Header from "../components/ui/Header";

function App() {
  return (
    <div className="App">
      <Header />
      .map( () => `Cras mattis consectetur purus sit amet fermentum. Cras justo odio, dapibus ac facilisis in, egestas
      eget quam. Morbi leo risus, porta ac consectetur ac, vestibulum at eros. Praesent commodo cursus magna, vel
      scelerisque nisl consectetur et.`, ) .join('\n')}
    </div>
  );
}

export default App;
